pragma solidity 0.7.6;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import {SafeMath} from "@openzeppelin/contracts/math/SafeMath.sol";
import {ISupraRouter} from "./interfaces/ISupraRouter.sol";
import {Rewards} from "./Rewards.sol";

contract RewardChest is Ownable, Rewards {
    using SafeMath for uint256;
    using Counters for Counters.Counter;

    ISupraRouter internal supraRouter;

    address supraAddr;
    address supraClientAddr;

    Counters.Counter _rewardChestCounter;

    struct rewardChestData {
        bool opened;
        uint256 randomReward;
    }

    mapping(uint256 => rewardChestData) chestData;

    mapping(uint256 => uint256) randomNumToLootBox;

    uint256 constant private MAX_POSSIBLE_REWARDS = 1;

    constructor(address _vrfAddress) {
        supraAddr = _vrfAddress;
        supraClientAddr = msg.sender;
    }

    function _ownerOf(address account, uint256 tokenId) internal view returns (bool) {
        return balanceOf(account, tokenId) != 0;
    }

    function mintRewardChest(address account) public onlyOwner {
        uint256 tokenId = _rewardChestCounter.current();
        _rewardChestCounter.increment();
        _mint(account, tokenId, 1, "");
    }

    function openRewardChest(address account, uint256 tokenId) public onlyOwner {
        require(_ownerOf(account, tokenId) == true, "Not owner of token.");
        require(chestData[tokenId].opened == false, "Reward Chest already opened.");

        uint256 nonce = ISupraRouter(supraAddr).generateRequest("finishRewardChest(uint256,uint256[])", 1, 1, supraClientAddr);
        randomNumToLootBox[nonce] = tokenId;

        mintRewards(account, nonce);
    }

    function finishRewardChest(uint256 nonce, uint256[] calldata rngList) internal {
        require(msg.sender == supraAddr, "Only supra router can call this function");

        chestData[randomNumToLootBox[nonce]].opened = true;
        chestData[randomNumToLootBox[nonce]].randomReward = rngList[0] % 100;
    }

    function mintRewards(address account, uint256 nonce) internal {
        uint256 randomNum = chestData[randomNumToLootBox[nonce]].randomReward;

        for (uint256 i = 0; i < MAX_POSSIBLE_REWARDS; i++) {
            if (randomNum < digitalWearable1DropRate) {
                mintSemiFungibleToken1(account, 1);
            } else if (randomNum < digitalWearable2DropRate) {
                mintSemiFungibleToken2(account, 1);
            } else {
                mintSemiFungibleToken3(account, 1);
            }
        }
    }
}
","keccak256":"0xf32f70df3be4c81b872faa4f19c10ce9cab55c591bb68561a032ed9ab7016edf","license":"MIT"},"contracts/Rewards.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity 0.7.6;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import {ISupraRouter} from "./interfaces/ISupraRouter.sol";

contract Rewards is ERC1155 {
    using Counters for Counters.Counter;

    // Counter for unique semi-fungible token IDs
    // Right now each reward token would have a unique ID which doesn't really
    // make them "semi-fungible". They would act more like erc-721 tokens
    // TODO: discuss with team and decide if each reward type should have the same tokenID per type 
    Counters.Counter _rewardsCounter;

    enum RewardId {
        digitalWearable1,
        digitalWearable2,
        digitalWearable3
    }
    uint256 constant NUM_REWARDS = 3;
    
    // Mappings to track minted semi-fungible tokens
    mapping(uint256 => uint256) public digitalWearable1Supply;
    mapping(uint256 => uint256) public digitalWearable2Supply;
    mapping(uint256 => uint256) public digitalWearable3Supply;

    //TODO: add functionality to change drop rate (should be onlyOwner)
    uint256 public constant digitalWearable1DropRate = 10;
    uint256 public constant digitalWearable2DropRate = 30;
    uint256 public constant digitalWearable3DropRate = 60;
    
    constructor() ERC1155("https://metadata.json") {

    }

    function mintSemiFungibleToken1(address account, uint256 amount) internal returns (uint256) {
        _rewardsCounter.increment();
        uint256 newTokenId = _rewardsCounter.current();
        digitalWearable1Supply[newTokenId] = amount;
        _mint(account, newTokenId, amount, "");
        return newTokenId;
    }

    function mintSemiFungibleToken2(address account, uint256 amount) internal returns (uint256) {
        _rewardsCounter.increment();
        uint256 newTokenId = _rewardsCounter.current();
        digitalWearable2Supply[newTokenId] = amount;
        _mint(account, newTokenId, amount, "");
        return newTokenId;
    }

    function mintSemiFungibleToken3(address account, uint256 amount) internal returns (uint256) {
        _rewardsCounter.increment();
        uint256 newTokenId = _rewardsCounter.current();
        digitalWearable3Supply[newTokenId] = amount;
        _mint(account, newTokenId, amount, "");
        return newTokenId;
    }
}","keccak256":"0x7791023247de80bbda29be1d3bc96b44cf4a2eda694b37f24799a2b814d40798","license":"MIT"},"contracts/interfaces/ISupraRouter.sol":{"content":"// SPDX-License-Identifier: MIT 
